import React from "react";
import {icons} from './dummyData';


const Daycard = ({data}) => {
  const {Date, Temperature, Day} = data
    return (
      <div className="flex flex-wrap" style={{margin: 'auto'}}>
          <div className="g:pt-12 pt-6 w-full md:w-4/12 px-4 text-center" 
          data-aos="fade-down" data-aos-duration="1200" >
          <div className="relative flex flex-col min-w-0 break-words bg-white w-full mb-8 shadow-lg rounded-lg">
            <div className="px-4 py-5 flex-auto">
              <div className="text-white p-3 text-center inline-flex items-center justify-cente mb-5 shadow-lg">
                <img src={Day?icons[Day.Icon]:''} />
              </div>
              <h6 className="text-xl font-semibold">{Date}</h6>
              <p className="mt-2 mb-4 text-gray-600">
                {Temperature?Temperature.Maximum.Value + ' ' + Temperature.Maximum.Unit:''}
              </p>
              <p>
              {Day?Day.IconPhrase:''}
             </p>
            </div>
          </div>
        </div>
      </div>
    );
}

export default Daycard;
